      SELECT 88 + ( - - col2 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 29 * - col0 * 95 * 80 BETWEEN + + col2 * + - 15 * - col2 AND NULL;
  - name: tab1

outputs:
